review:
Produk:
Tampilan cukup menarik dgn warna ngejreng;

Build quality: 
- dimensi kecil dan secara umum cukup baik;
- tutup pengering kendor, berisik saat mengeringkan pakaian;
- suara mesin halus saat cuci pakaian;
- suara mesin kasar dan bergetar hebat saat mengeringkan (mesin cuci sampai  geser tak beraturan);

Ekspedisi:
+ Pesan jumat, selasa siang sampai rumah;
+Paket diterima dgn kondisi baik, meski dus penyok tapi tidak merusak mesin;
+'Dikirim via jne trucking TOP
